import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import Typecard from "./Typecard";

const Usertype = () => {
    return (
        <Box sx={{width:"100%", height:"100%", display:"flex", justifyContent:"center", alignItems:"center", flexDirection:"column"}}>
            <Typography component="h2" sx={{mt:"50px", color:"#00D000", fontSize:"30px"}}>"REGISTER  AS..."</Typography>
            <Box sx={{display:"flex", mt:"50px"}}>
                <Typecard type="User" title="Account for individuals" content={["Sign-up for events", "Create basic free events", "Track visited events", "Favourite events and organisations", "Joind event message board"]} />
                <Typecard type="Organisation" title="Account for companies, organisations and users creating paid events." content={["Create advanced events", "Organisation page", "Manager account", "Subscription features (offer deals, multiple even tags, create multiple events at one time and more)"]} />
            </Box>
        </Box>
    )
}

export default Usertype;
